import React, {useState} from 'react';

class DataForm extends component{
    constrauctor(props){
      this.state = {
        houseName:"",
        Zipcode: ""
      };
      this.formChange = this.formChange.bind(this);
    };
  }
function formChange(e) {
    this.setState({
      [e.target.name]: e.target.value
    });
}
